INSERT INTO `utm_film` (`utm_film_id`, `utm_film_title`, `utm_film_wiki_url`, `utm_film_description`, `utm_film_release_year`, `utm_film_release_date`, `utm_film_awards_info`, `utm_film_language`, `utm_film_created_by`, `utm_film_created_date`, `utm_film_updated_date`, `utm_film_updated_by`) VALUES
(10, 'Manmadhudu', '/wiki/Manmadhudu', 'Subscribe For More Entertainment: http://goo.gl/3Mlqzx\nLike us on Facebook @ https://www.facebook.com/annapurnastudios\n  \n\nManmadhudu  is a 2002 romantic comedy Telugu film directed by K. Vijaya Bhaskar and has Akkineni Nagarjuna in the lead role. Sonali Bendre and Anshu play female leads. The film was later remade as Aishwarya in Kannada, marking the debut of Deepika Padukone.\n\n\n\nPlot\n\nAbhiram (Nagarjuna) is a manager in his ad agency. He despises women and feels that all women are traitors. Abhiram''s uncle (Tanikella Bharani), who is the chairman of the ad agency, appoints Harika (Sonali Bendre) as the assistant manager. Though Abhiram does not like a girl joining his company, he has to live with it as the appointment is made by his uncle. He starts mistreating her. Harika, vexed by Abhiram''s acts, submits her resignation to his uncle, who then narrates Abhiram''s past to Harika.\n\nAbhi was born with a golden spoon. He was raised by his grandfather (Balayya) as his parents died soon after the Abhi''s birth. Abhi falls in love with Maheswari (Anshu), who is the niece of an employee (Chandra Mohan) in Abhi''s grandfather''s company. Alarmed by this, Maheshwari''s uncle takes her away to his home town and arranges her engagement with another man. Abhi travels all the way to the venue and takes Maheswari away. While returning, they meet with an accident. After 10 days, when Abhi comes out of coma, he is told that Maheswari is about to marry some other guy. Shocked by this news, Abhi develops hatred towards women. After narrating the flashback, Abhi''s uncle promotes Harika as the Manager and demotes Abhi to the post of Assistant Manager. Although Abhi resents this, he travels to Paris with Harika for a business venture. While there, he falls in love with her. Problems soon arise, and when they return, Harika is arranged to marry another man. However, Abhi realizes his true feelings for her at last, and they end up together. \nCast\n\n    Akkineni Nagarjuna as Abhiram\n    Sonali Bendre as Harika\n    Anshu as Maheswari\n    Chandramohan as Maheswari''s uncle\n    Tanikella Bharani as Prasad\n    Brahmanandam as Lavangam\n    M. Balaiah as Abhiram''s Grandfather\n    Suneel as Bunk Seenu\n    Ranganath as Father of Harika\n    Sudha as Lakshmi\n    Dharmavarapu Subramanyam as Prof. Balasubramaniam\n    Melkote as Sundar\n    Swapna Madhuri as Swapna\n    Rekha Vedavyas (Cameo)\n    Keerthi Chawla (Cameo)\n\nSoundtrack\n\nThe soundtrack of the film was composed by Devi Sri Prasad, with lyrics written by Sirivennela Sitaramasastri and Bhuvanachandra.\nSong  Singer(s)  Duration  Lyricist\nDon`t Marry  S.P.Balasubrahmanyam  5:40  Sirivennela Sitaramasastri\nGundello Emundho  Venu, Sumangali  4:38\nNenu Nenuga Lene  S. P. B. Charan  3:55\nNa Manasune  S.P.Balasubrahmanyam, K. S. Chitra  4:06\nCheliya Cheliya  Shaan  4:14\nAndhamaina Bhamalu  Devi Sri Prasad  4:18  Bhuvanachandra ---test--Akkineni Nagarjuna, Sonali Bendre, Anshu', '0000-00-00 00:00:00', '2002-12-20', '', 'Telugu', 'MAK', '2014-06-06 15:16:19', '2014-06-06 09:46:20', 'MAK'),
(12, 'Mass', 'http://en.wikipedia.org/wiki/Mass_(film)', 'Subscribe For More Entertainment: http://goo.gl/3Mlqzx\nLike us on Facebook @ https://www.facebook.com/annapurnastudios \n \nMass is a 2004 Tollywood film written and directed by Raghava Lawrence. The film has Akkineni Nagarjuna and Jyothika in lead roles with Charmme Kaur playing a supporting role. Akkineni Nagarjuna also produced the film on his home production, Annapurna Studios. The film released on 23 December 2004. The film was dubbed into Tamil with the title Veeran, which also became a blockbuster and Hindi as Meri Jung -- One Man Army.\n\nPlot\n\nMass (Akkineni Nagarjuna) is an orphan, who bonds well with his landlord''s son Adi (Sunil). He is behind a collegian Anjali (Jyothika) who happens to be the daughter of Vizag city''s mafia don Satya (Raghuvaran). This restricts her from falling for him, as it would land him in danger but she finally gives in after some time. She suggests that he ties the knot immediately before her brother (Rahul Dev) and father try separating them. The gangsters in the process kill Mass''s best friend Adi, when he tries to stop them when they try separating the lead pair, before their marriage. The hero moves into Vizag and stays in an apartment hiding his identity to take revenge on the mafia dons. Finally his quest for revenge is complete, and also he eliminates the anti-social elements in the society by killing them.\nCast & Crew\n\n    Akkineni Nagarjuna ... Mass/Ganesh\n    Jyothika ... Anjali\n    Rahul Dev ... Seshu\n    Charmme Kaur ... Priya\n    Arman kohli ... Satya\n    Sunil ... Adi\n    Prakash Raj ... Durga Prasad (Guest appearance)\n\nCrew\n\n    Director: Raghava Lawrence\n    Screenplay: Raghava Lawrence\n    Story: Raghava Lawrence\n    Dialogue: Paruchuri Brothers\n    Producer: Aditya Chopra\n    Music: Devi Sri Prasad\n    Cinematography: Nirav Shah\n    Editor: Marthand K. Venkatesh\n    Art Director: Thotta Tharani\n    Choreography: Raghava Lawrence\n    Stunts: Allan Amin\n\nSoundtrack\n\nThe audio was released in an entertaining function held at Taramati Baradari (Golkonda). Incidentally Mass audio function is the first filmy function organised at this historic venue (an amphitheater) which honour was missed by Shankar Dada MBBS Due to Heavy Rains. This function is graced by the family members of Akkineni -- ANR, Nagarjuna, Sumanth, Naga Chaitanya & Akhil. The technicians who attended this function include Lawrence, Devi Sri Prasad, Paruchuri brothers, Bhaskarabhatla Ravi Kumar and Viswa. The other celebrities who made it to the function include KS Rama Rao, D Suresh Babu, KL Narayana, S Gopal Reddy, Gemini Kiran and Puri Jagan.\nTracklist  \nNo.  Title  Lyrics  Singer(s)  Length  \n1.  "Mass"    Sahithi  Mano, Ravi Varma  4:09\n2.  "Valu Kalla Vayyari"    Bhaskarabhatla  Karthik  5:34\n3.  "Indhurudu Chandurudu"    Sahithi  Ranjith, Kalpana  5:19\n4.  "Kottu Kottu Kottu"    Sahithi  Tippu, Prasanna  5:22\n5.  "La La Lahirey"    Viswa  Venu, Sunitha Sarathy  4:34\n6.  "Natho Vasthava"    Sahithi  Udit Narayan, Sumangali  4:54 ---test--Nagarjuna, Jyothika, Charmme', '0000-00-00 00:00:00', '2004-12-23', '', 'Telugu', 'MAK', '2014-06-06 15:28:38', '2014-06-06 09:58:39', 'MAK');
