(4, 'https://www.youtube.com/watch?v=mf7sk4IydGo&feature=youtube_gdata', 'Manmadhudu', 'Subscribe For More Entertainment: http://goo.gl/3Mlqzx\nLike us on Facebook @ https://www.facebook.com/annapurnastudios\n  \n\nManmadhudu  is a 2002 romantic comedy Telugu film directed by K. Vijaya Bhaskar and has Akkineni Nagarjuna in the lead role. Sonali Bendre and Anshu play female leads. The film was later remade as Aishwarya in Kannada, marking the debut of Deepika Padukone.\n\n\n\nPlot\n\nAbhiram (Nagarjuna) is a manager in his ad agency. He despises women and feels that all women are traitors. Abhiram''s uncle (Tanikella Bharani), who is the chairman of the ad agency, appoints Harika (Sonali Bendre) as the assistant manager. Though Abhiram does not like a girl joining his company, he has to live with it as the appointment is made by his uncle. He starts mistreating her. Harika, vexed by Abhiram''s acts, submits her resignation to his uncle, who then narrates Abhiram''s past to Harika.\n\nAbhi was born with a golden spoon. He was raised by his grandfather (Balayya) as his parents died soon after the Abhi''s birth. Abhi falls in love with Maheswari (Anshu), who is the niece of an employee (Chandra Mohan) in Abhi''s grandfather''s company. Alarmed by this, Maheshwari''s uncle takes her away to his home town and arranges her engagement with another man. Abhi travels all the way to the venue and takes Maheswari away. While returning, they meet with an accident. After 10 days, when Abhi comes out of coma, he is told that Maheswari is about to marry some other guy. Shocked by this news, Abhi develops hatred towards women. After narrating the flashback, Abhi''s uncle promotes Harika as the Manager and demotes Abhi to the post of Assistant Manager. Although Abhi resents this, he travels to Paris with Harika for a business venture. While there, he falls in love with her. Problems soon arise, and when they return, Harika is arranged to marry another man. However, Abhi realizes his true feelings for her at last, and they end up together. \nCast\n\n    Akkineni Nagarjuna as Abhiram\n    Sonali Bendre as Harika\n    Anshu as Maheswari\n    Chandramohan as Maheswari''s uncle\n    Tanikella Bharani as Prasad\n    Brahmanandam as Lavangam\n    M. Balaiah as Abhiram''s Grandfather\n    Suneel as Bunk Seenu\n    Ranganath as Father of Harika\n    Sudha as Lakshmi\n    Dharmavarapu Subramanyam as Prof. Balasubramaniam\n    Melkote as Sundar\n    Swapna Madhuri as Swapna\n    Rekha Vedavyas (Cameo)\n    Keerthi Chawla (Cameo)\n\nSoundtrack\n\nThe soundtrack of the film was composed by Devi Sri Prasad, with lyrics written by Sirivennela Sitaramasastri and Bhuvanachandra.\nSong  Singer(s)  Duration  Lyricist\nDon`t Marry  S.P.Balasubrahmanyam  5:40  Sirivennela Sitaramasastri\nGundello Emundho  Venu, Sumangali  4:38\nNenu Nenuga Lene  S. P. B. Charan  3:55\nNa Manasune  S.P.Balasubrahmanyam, K. S. Chitra  4:06\nCheliya Cheliya  Shaan  4:14\nAndhamaina Bhamalu  Devi Sri Prasad  4:18  Bhuvanachandra ---test--Akkineni Nagarjuna, Sonali Bendre, Anshu', '', 'active', 0, 'HD', 0, 10, 'youtube', 'MAK', '2014-06-06 15:16:19', 'MAK', '2014-06-06 09:46:22');
